import React from 'react';
import whiteLogo from '../../styles/images/whiteLogo.png';
import { AiOutlineHome } from 'react-icons/ai';
import { CgScreen } from 'react-icons/cg';
import { BsCardImage } from 'react-icons/bs';
import { ScrollPanel } from 'primereact/scrollpanel';
import 'primereact/resources/themes/saga-blue/theme.css';
import 'primereact/resources/primereact.min.css';
import '../../styles/css/layout.css';

const style = {
    main: {
        display: 'flex',
        flexDirection: 'column',
        height: '100%',
        width: '100%',
        background: '#ff773b'
    },
    navbar: {
        height: '10%',
        width: '100%',
        display: 'flex',
        alignItems: 'center',
        justifyContent: 'center'
    },
    section: {
        height: '90%',
        width: '100%',
        display: 'flex',
        alignItems: 'center'
    },
    sidebar: {
        height: '92%',
        width: '168px',
        marginLeft: '63px',
        background: '#F77445',
        borderRadius: '5px',
        display: 'flex',
        alignItems: 'center',
        flexDirection: 'column'
    },
    content: {
        height: '92%',
        width: '83.3%',
        borderRadius: '5px',
        marginLeft: '45px',
        marginRight: '45px',
        background: '#FB931A',
        display:'flex',
        alignItems:'center',
        justifyContent:'center'
    },
    buttonSide: {
        marginTop: '14px',
        borderRadius: '2px',
        display: 'flex',
        justifyContent: 'center',
        alignItems: 'center',
        width: '90%',
        height: '40px',
        background: '#F99571',
        cursor: 'pointer',
        color: '#fff',
        fontFamily: 'Quicksand',
        fontWeight: 'lighter'
    },
    iconStyle: {
        marginRight: '8px'
    }
}

const Layout = (props) => {
    return (
        <main style={style.main}>
            <section style={style.navbar}>
                <img src={whiteLogo} style={{ marginTop: '8px', height: '75px', width: '150px', marginLeft: '20px' }} alt="CNX Telecom - você sempre conectado!" />
            </section>
            <section style={style.section}>
                <aside style={style.sidebar}>
                    <div style={style.buttonSide}><AiOutlineHome style={style.iconStyle} />Dashboard</div>
                    <div style={style.buttonSide}><CgScreen style={style.iconStyle} />Telas</div>
                    <div style={style.buttonSide}><BsCardImage style={style.iconStyle} />Conteúdos</div>
                </aside>
                <div style={style.content} className='raised'>
                    {
                        props.scrollpanel ? <ScrollPanel style={{width:'100%', height:'100%', background:'#F77445', borderRadius:'3px'}}>{props.children}</ScrollPanel>
                        : props.children
                    }
                    
                </div>
            </section>
        </main>
    )
}

export default Layout;
